/**
 * Functional components, there is no need to use states
 */
import React from 'react';

const About = () => {
  return (
    <div className="container">
      <h4 className="center">Helps you plan where to study without going there!</h4>
      <h5 className="center">Proudly brought to you by our hackathon members:</h5>
    </div>
  )
}



export default About;
